import React from 'react';
import Sidebar from './components/Sidebar';
import Topbar from './components/Topbar';
import DashboardContent from './components/DashboardContent';
import './App.css'; // Your main CSS file

const App = () => {
  return (
    <div className="app">
      <Sidebar />
      <Topbar />
      <DashboardContent />
    </div>
  );
};

export default App;
